import { json } from "body-parser";
import React from "react";
import {useState, useEffect} from "react";

function Todo(){

    const [data, setData]= useState([])
    const item=[];
    const apiGet = ()=>{
        fetch('http://localhost:1337/api/notice')
        .then((response)=>response.json())
        .then((json)=>{
            setData(json);
            for(let i=0;i<3;i=i+1){
                item.push(json.user[i].name);
                console.log(json.user[i]);
            }
        })
    }

    useEffect(()=>{
        apiGet();  
    },[])



    return (
        <div>

            <h1>Hi</h1>
            <h2>NOTICE</h2>
            <ul>
                {item.map(name => (
                <li>{name}</li>
                ))}
            </ul>
        </div>
    )
}

export default Todo

